def countingValleys(steps, path):
    # Write your code here

    numOfValleys = 0
    count = 0
    for p in path:
        if p == 'D':
            count -= 1
        if p == 'U':
            count += 1
        if count == 0 and p == 'U':
            numOfValleys += 1

    return numOfValleys


path = ''
steps = 8
print(countingValleys(steps, path))
